import React from "react";
import "../Header/Header.scss";
import Navigation from "../Navigation/Navigation";
import Slider from "../Slider/Slider";

export default function Header() {
    return (
        <header className="header">
            <div className="header__container">
                <div className="header__top">
                    <Navigation />
                    <div className="header__func-block">
                        <button className="header__login login">

                        </button>
                        <button className="header__search">
                            <svg width="22.67" height="22.67" viewBox="0 0 18 18" fill="none" xmlns="http://www.w3.org/2000/svg">
                                <path fillRule="evenodd" clipRule="evenodd" d="M11.0586 11.0586C11.2538 10.8633 11.5704 10.8633 11.7657 11.0586L17.3536 16.6464C17.5488 16.8417 17.5488 17.1583 17.3536 17.3536C17.1583 17.5488 16.8417 17.5488 16.6464 17.3536L11.0586 11.7657C10.8633 11.5704 10.8633 11.2538 11.0586 11.0586Z" fill="white" fillOpacity="0.8" />
                                <path fillRule="evenodd" clipRule="evenodd" d="M0.5 7C0.5 3.41015 3.41015 0.5 7 0.5C10.5899 0.5 13.5 3.41015 13.5 7C13.5 10.5899 10.5899 13.5 7 13.5C3.41015 13.5 0.5 10.5899 0.5 7ZM7 1.5C3.96243 1.5 1.5 3.96243 1.5 7C1.5 10.0376 3.96243 12.5 7 12.5C10.0376 12.5 12.5 10.0376 12.5 7C12.5 3.96243 10.0376 1.5 7 1.5Z" fill="white" fillOpacity="0.8" />
                            </svg>
                        </button>
                    </div>
                </div>
                <Slider />
            </div>
        </header>
    );
}
